import { Move } from './move';

export const Indexes = history.map(({location}, historyIndex) => (
    <Move key={`move-${historyIndex}`} jumpTo={jumpTo} location={location} historyIndex={historyIndex} currentMove={currentMove} changeOrder={changeOrder} />
  ));
